import React from 'react';
import Home from '../src/components/home/home';
import data from '../src/data/db.json'
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import { useState } from 'react';

function App() {
  return (


    <Router>
    <div>

      <Home DATA = {data} />
      <Routes>
      <Route path='/' element={<Home />} />
      </Routes>




    </div>
  </Router>
);




}

export default App;
